import './Dialogs.css';
import ItemDialogs from "./ItemDialogs/Dialogs";

const Dialogs = () => {
	return (
		<div className='dialogs'>
			<div className="dialogs__title">Dialogs</div>
			<div className="dialogs__body">
				<ul className="dialogs__list">
					<ItemDialogs/>
				</ul>
				<div className="dialogs__current">
					Lorem ipsum dolor sit amet, consectetur adipisicing elit.
					Commodi distinctio et nam necessitatibus nihil non soluta unde.
					Ab aperiam dolor ipsum quasi vero! Deleniti error facere, fugiat,
					inventore ipsam iste itaque laudantium, natus pariatur
					perspiciatis porro quam quod ratione reiciendis sequi veniam
					veritatis. Ad eum itaque perspiciatis porro, repellat temporibus?
				</div>
			</div>
		</div>
	)
}

export default Dialogs;
